import {useState} from 'react';
import Menu from "./Menu/Menu";

const App = ()=>{
  // const Homepage = ()=>{
  //   const design = (
  //     <>
  //
  //     </>
  //   );
  //   return design;
  // }
  const Tr = ({hf})=>{
    const design = (
      <h1>{hf.age}</h1>
    );
    return design;
  }
  const[data,setData] = useState("HELLO");
  const design = (
    <>
    <h1>{data}</h1>
    <button onClick={()=>setData("WAP")}>Click</button>
    {
      Menu.map((item,index)=>{
        return <Tr itemData={item} key={index} />
      })
    }
    </>
  );
  return design;
}

export default App;
